    SettingFilled,
    SmileOutlined,
    SyncOutlined,
    LoadingOutlined,
    BulbTwoTone,
    PieChartTwoTone,
    StarTwoTone,
    FundTwoTone,
    CompassTwoTone

  } from '@ant-design/icons';
import { Layout, Menu, Breadcrumb,Button,Space,Card, Col, Row} from 'antd';
import React from 'react';
import { Routes,BrowserRouter as Router,Route,Link,NavLink,Outlet  } from 'react-router-dom';

const { Header, Content, Footer } = Layout;
class Home extends React.Component{
    render(){
        return(

            // <div style={{justifyContent: 'center'},{textAlign: 'center'},{margin: "auto"},{top:0},{left: 0},{right: 0},{bottom: 0}}>
                
                
                
               
                
                // {/* <BulbTwoTone style={{ fontSize: '100px', color: '#08c'}} key="visual"> </BulbTwoTone>
