                // {/* <div className="site-card-wrapper" style={{justifyContent: 'center'}, {textAlign: 'center'}}>
                <Layout>
                    <Layout>
                        <Header style={{height:"90px"}}>
                       <div style={{fontWeight: "bold"},{fontSize: "80px"}}>Bronze Ware</div> 
                        </Header>
                    </Layout>
                    <br/>
                <Layout style={{textAlign: 'justify'}}>
                <Content style={{textAlign: 'center'},{ padding: '0 50px' },{height:"500px"}}>
                    <Layout>
                    <div className="site-card-wrapper" style={{textAlign: 'center'}}>
                    <Row gutter={16}>
                    <Col span={5}>
                        <Card  hoverable title="基础功能" bordered={false} key="visual" style={{textAlign: 'center'}}>
